import { Grid, Typography ,Paper} from '@mui/material'
import React from 'react'

const Dashboard = () => {
  return (
    <div>
      <Grid
      container

      spacing={0}
      direction="row"
      justifyContent="center"
      alignItems="stretch"
      style={{
        border:'2px solid red'


      }}
      >






        <Paper variant="outlined" square 
        sx ={{

          width:300,
          height:300



        }}/>

      </Grid>
{/* CODE HERE */}
<Typography variant='h1'> Hi this is a Dashboard</Typography>

    </div>
  )
}

export default Dashboard
